import React from 'react'
import { Container } from './styles'

const Button = ({ children, whiteSchema = true, ...rest }) => {
  return (
    <Container whiteSchema={whiteSchema} type="button" {...rest}>
        {children}
    </Container>
  )
}

export default Button
